El Monitor de Turismo en las Provincias que acá presentamos procura servir como herramienta de consulta de los últimos datos disponibles de una variedad de indicadores relativos al turismo en la Argentina, poniendo el foco en el nivel provincial.
INDICADORES
Los Indicadores por provincia incluyen la siguiente información:
Turismo Interno: Una caracterización del Turismo Interno a partir de la Encuesta de Viajes y Turismo de los Hogares (EVyTH).
Turismo Receptivo: Estimaciones del turismo receptivo a nivel provincial, detallando el flujo de turistas no residentes que salieron por cada paso fronterizo.
Padrón de Alojamientos: Indicadores relevantes de la oferta hotelera y parahotelera proveniente del Padrón Único Nacional de Alojamientos (PUNA).
Áreas Naturales: Registro de visitaciones a áreas naturales protegidas de carácter nacional a partir de información de la Administración de Parques Nacionales (APN).
Conectividad Aérea: Datos provenientes de los registros administrativos de la Autoridad Nacional de Aviación Civil (ANAC).
Empresas Turísticas: Estadísticas de empresas de las Ramas Características del Turismo (RCT) a partir de datos de la Administración Federal de Ingresos Públicos (AFIP).
